import React from 'react';
// components
import Header from './layouts/Header';
import Footer from './layouts/Footer';
function Shop(){
    return(
        <div>
            <Header/>
            <div className="background background-homepage">
                <div className="container homepage">
                    <span className="homepage-slogan">Best things for your boss</span>
                    <span></span>
                    <span></span>
                    <span className="homepage-btn">Let's explore </span>
                    <span></span>
                    <span></span>
                    <div className="homepage-slogan2">
                        <img src={process.env.PUBLIC_URL +"/slogan.jpg"} alt="slogan" className="homepage-slogan2-img"></img>
                        <span className="homepage-slogan2-text">abc</span>
                    </div>
                    <span></span>
                    <span>c</span>
                </div>
            </div>
            <Footer/>       
        </div>
    )
};
export default Shop;
